import re
import timeit


def decompress(compressed_data):
    # Find the values and keys of the deepest level
    inners = re.findall(r"\d+\[+\w+]|\d+\[+]", compressed_data)
#loops thorugh numbers and strings taking the string inside the bracket and multiplying it through the number.
    for val in inners:
        split_pair = val.split('[')
        long_letters = int(split_pair[0]) * split_pair[1][:-1]
        compressed_data = compressed_data.replace(val, long_letters)
# checks for any more compression before ending the loop or running through it again.
    if not inners:
        return compressed_data
    else:
        return decompress(compressed_data)




def test():
    # multidigit
    test0 = '10[a]'
    answer = decompress(test0)
    assert answer == 'aaaaaaaaaa', \
        "answer was %s, not aaaaaaaaaa: " % answer

    # nested
    test1 = '2[3[a]b]'
    answer = decompress(test1)
    assert answer == 'aaabaaab', \
        "answer was %s, not aaabaaab: " % answer

    # recursive
    test2 = 'long2[chain]withlots3[3[of]chain]1[and2[some2[recursion]]]'
    answer = decompress(test2)
    assert answer == 'longchainchainwithlotsofofofchainofofofchainofofofchainandsomerecursionrecursionsomerecursionrecursion', \
        "answer was %s, not aaabaaab: " % answer

    # banger
    test3 = '2[2[2[2[2[2[a]b]c]d]e]f]g'
    answer = decompress(test3)
    assert answer == 'aabaabcaabaabcdaabaabcaabaabcdeaabaabcaabaabcdaabaabcaabaabcdefaabaabcaabaabcdaabaabcaabaabcdeaabaabcaabaabcdaabaabcaabaabcdefg', \
        "answer was %s, not aabaabcaabaabcdaabaabcaabaabcdeaabaabcaabaabcdaabaabcaabaabcdefaabaabcaabaabcdaabaabcaabaabcdeaabaabcaabaabcdaabaabcaabaabcdefg: " % answer

    # marks tests
    assert decompress('5[abc]4[ab]c') == 'abcabcabcabcabcababababc'
    assert decompress('2[3[a]b]') == 'aaabaaab'
    assert decompress('0[abc]') == ''
    assert decompress('5[0[a]]abc') == 'abc'
    assert decompress('5[1[a]]abc') == 'aaaaaabc'
    assert decompress('10[a]') == 'aaaaaaaaaa'
    assert decompress('2[5[a]ab]') == 'aaaaaabaaaaaab'

    # the real test 143 char -> 164999
    test_4 = '56[jjjjjsdfhhdhfdhfhdf100[eatdi0[43[jsdbf5[dujh4[ttttt]vdu]vlwsdhfbv]]cksjord10[a]n]hdfhdhfdfhd23[]40[3[james]]fhdhfdhfdhfhdfhd]'
    answer = decompress(test_4)
    assert answer == ''


def main():
    test()
    t = timeit.Timer(test)
    print(t.timeit(200)/100)


if __name__ == '__main__':
    main()